(52, 11, 'Peinture Prestige', 'Service de peinture professionnelle avec une attention particulière aux détails, utilisant des matériaux de qualité supérieure pour des résultats durables.', 4, '89', '0', NULL, '[\"peinture5.jpg\",\"peinture8.jpg\",\"peinture1.jpg\",\"peinture4.jpg\",\"peinture6.jpg\",\"peinture3.jpg\"]'),
(53, 19, 'Voyageur Élite', 'Transport sur mesure avec chauffeur pour toutes vos occasions, offrant ponctualité, sécurité et un service de haute qualité.', 6, '43', '0', NULL, '[\"chauffeur1.jpg\",\"chauffeur9.jpg\",\"chauffeur6.jpg\"]'),
(54, 10, 'Volt & Co', 'Spécialistes en installation de réseaux électriques pour bureaux et habitations, avec une attention particulière à la qualité et à la sécurité.', 2, '34', '0', NULL, '[\"electricit\\u00e94.jpg\",\"electricit\\u00e93.jpg\"]'),
(55, 14, 'Sparkle Service', 'Nettoyage résidentiel et commercial de haute qualité, offrant des résultats éclatants et une satisfaction garantie.', 1, '65', '0', NULL, '[\"nettoyage9.jpg\",\"nettoyage6.jpg\"]'),
(56, 17, 'Électricité Avantage', 'Solutions électriques innovantes pour vos projets résidentiels et commerciaux, avec un service rapide et des tarifs compétitifs.', 2, '78', '0', NULL, '[\"electricit\\u00e95.jpg\",\"electricit\\u00e94.jpg\",\"electricit\\u00e97.jpg\",\"electricit\\u00e96.jpg\"]'),
(57, 19, 'Plomberie Expert', 'Équipe de plombiers qualifiés pour résoudre tous vos problèmes de plomberie, avec un service rapide et des tarifs transparents.', 3, '79', '0', NULL, '[\"plomberie1.jpg\",\"plomberie9.jpg\",\"plomberie3.jpg\",\"plomberie6.jpg\"]'),
(58, 10, 'Teintes et Ambiances', 'Création d\'ambiances sur mesure avec une large gamme de couleurs et de finitions, adaptée à vos goûts et à votre style de vie.', 4, '45', '0', NULL, '[\"peinture5.jpg\"]'),
(59, 15, 'Maestro des Couleurs', 'Service de peinture artistique et décorative, transformant vos murs en véritables œuvres d\'art grâce à des techniques innovantes.', 4, '3', '0', NULL, '[\"peinture6.jpg\",\"peinture2.jpg\",\"peinture9.jpg\"]'),
(60, 15, 'Clarté Express', 'Service de nettoyage rapide et efficace pour maisons et bureaux, utilisant des produits de qualité pour un résultat impeccable.', 1, '61', '0', NULL, '[\"nettoyage8.jpg\",\"nettoyage5.jpg\"]');
